import { Link } from 'react-router-dom';

const StartPage = () => {
    return (
        <section className="home">
            <div>
                <h1>Are We There, Yeti?</h1>
                <button>Start Game</button>
                <Link to='/game' className="btn">Play Game</Link>
            </div>
        </section>
    )
}

export default StartPage;
